import React from "react";
import {
  AiFillGithub,
  AiFillSetting,
  AiFillQuestionCircle,
} from "react-icons/ai";

const NavBar = () => {
  return (
    <div className="fixed top-0 left-0 w-full h-10 m-0 flex flex-row bg-gray-900 text-white shadow-md">
      <SideBarIcon icon={<AiFillGithub size="28" />} />
      <i>B</i>
      <i>C</i>
      <i>D</i>
    </div>
  );
};

const SideBarIcon = ({ icon }) => {
  return <div className="sidebar-icon">{icon}</div>;
};

export default NavBar;
